@SuppressWarnings("unchecked")
public class AdminGovernBuilder extends Contract {
    public static final String[] BINARY_ARRAY = {
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        ""
    };

    public static final String BINARY =
            org.fisco.bcos.sdk.v3.utils.StringUtils.joinAll("", BINARY_ARRAY);

    public static final String[] SM_BINARY_ARRAY = {
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        ""
    };

    public static final String SM_BINARY =
            org.fisco.bcos.sdk.v3.utils.StringUtils.joinAll("", SM_BINARY_ARRAY);

    public static final String[] ABI_ARRAY = {
        "[{\"conflictFields\":[{\"kind\":4,\"value\":[0]}],\"constant\":true,\"inputs\":[],\"name\":\"_governance\",\"outputs\":[{\"name\":\"\",\"type\":\"address\"}],\"payable\":false,\"selector\":[472858173,229043948],\"stateMutability\":\"view\",\"type\":\"function\"},{\"conflictFields\":[{\"kind\":4,\"value\":[0]}],\"constant\":true,\"inputs\":[],\"name\":\"getGovernance\",\"outputs\":[{\"name\":\"\",\"type\":\"address\"}],\"payable\":false,\"selector\":[681262093,2581420929],\"stateMutability\":\"view\",\"type\":\"function\"},{\"conflictFields\":[{\"kind\":0}],\"constant\":true,\"inputs\":[],\"name\":\"getAccountManager\",\"outputs\":[{\"name\":\"\",\"type\":\"address\"}],\"payable\":false,\"selector\":[3003329512,3911268826],\"stateMutability\":\"view\",\"type\":\"function\"},{\"inputs\":[],\"payable\":false,\"stateMutability\":\"nonpayable\",\"type\":\"constructor\"},{\"anonymous\":false,\"inputs\":[{\"indexed\":false,\"name\":\"governanceAddress\",\"type\":\"address\"},{\"indexed\":false,\"name\":\"accountManagerAddress\",\"type\":\"address\"}],\"name\":\"LogCreate\",\"type\":\"event\"}]"
    };

    public static final String ABI = org.fisco.bcos.sdk.v3.utils.StringUtils.joinAll("", ABI_ARRAY);

    public static final String FUNC__GOVERNANCE = "_governance";

    public static final String FUNC_GETGOVERNANCE = "getGovernance";

    public static final String FUNC_GETACCOUNTMANAGER = "getAccountManager";

    public static final Event LOGCREATE_EVENT =
            new Event(
                    "LogCreate",
                    Arrays.<TypeReference<?>>asList(
                            new TypeReference<Address>() {}, new TypeReference<Address>() {}));;

    protected AdminGovernBuilder(String contractAddress, Client client, CryptoKeyPair credential) {
        super(getBinary(client.getCryptoSuite()), contractAddress, client, credential);
    }

    public static String getBinary(CryptoSuite cryptoSuite) {
        return (cryptoSuite.getCryptoTypeConfig() == CryptoType.ECDSA_TYPE ? BINARY : SM_BINARY);
    }

    public static String getABI() {
        return ABI;
    }

    public String _governance() throws ContractException {
        final Function function =
                new Function(
                        FUNC__GOVERNANCE,
                        Arrays.<Type>asList(),
                        Arrays.<TypeReference<?>>asList(new TypeReference<Address>() {}));
        return executeCallWithSingleValueReturn(function, String.class);
    }

    public String getGovernance() throws ContractException {
        final Function function =
                new Function(
                        FUNC_GETGOVERNANCE,
                        Arrays.<Type>asList(),
                        Arrays.<TypeReference<?>>asList(new TypeReference<Address>() {}));
        return executeCallWithSingleValueReturn(function, String.class);
    }

    public String getAccountManager() throws ContractException {
        final Function function =
                new Function(
                        FUNC_GETACCOUNTMANAGER,
                        Arrays.<Type>asList(),
                        Arrays.<TypeReference<?>>asList(new TypeReference<Address>() {}));
        return executeCallWithSingleValueReturn(function, String.class);
    }

    public List<LogCreateEventResponse> getLogCreateEvents(TransactionReceipt transactionReceipt) {
        List<EventValuesWithLog> valueList =
                extractEventParametersWithLog(LOGCREATE_EVENT, transactionReceipt);
        ArrayList<LogCreateEventResponse> responses =
                new ArrayList<LogCreateEventResponse>(valueList.size());
        for (EventValuesWithLog eventValues : valueList) {
            LogCreateEventResponse typedResponse = new LogCreateEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.governanceAddress =
                    (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.accountManagerAddress =
                    (String) eventValues.getNonIndexedValues().get(1).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

    public static AdminGovernBuilder load(
            String contractAddress, Client client, CryptoKeyPair credential) {
        return new AdminGovernBuilder(contractAddress, client, credential);
    }

    public static AdminGovernBuilder deploy(Client client, CryptoKeyPair credential)
            throws ContractException {
        return deploy(
                AdminGovernBuilder.class,
                client,
                credential,
                getBinary(client.getCryptoSuite()),
                getABI(),
                null,
                null);
    }

    public static class LogCreateEventResponse {
        public TransactionReceipt.Logs log;

        public String governanceAddress;

        public String accountManagerAddress;
    }
}
